var favLocations=[{name:"Home, Crayford",lat:51.45021,lng:.180518},{name:"Channel 4, London",lat:51.496026,lng:-.132962},{name:"Olympic Park, London",lat:51.546307,lng:-.020001},{name:"Amsterdam, Netherlands",lat:52.361212,lng:4.878265},{name:"Dieppe, France",lat:49.933543,lng:1.08905}],markers=function(n){this.name=ko.observable(n.name),this.lat=ko.observable(n.lat),this.lng=ko.observable(n.lng),this.marker=ko.observable()},viewModel=function(){var n=this;this.locationList=ko.observableArray([]),favLocations.forEach(function(a){n.locationList.push(new markers(a))});var a,e=new google.maps.InfoWindow;this.locationList().forEach(function(n){a=new google.maps.Marker({position:new google.maps.LatLng(n.lat(),n.lng()),map:map,title:n.name(),animation:google.maps.Animation.DROP}),n.marker=a,n.marker.addListener("click",function(){e.setContent('<div id="content"><h1>'+n.name()+'</h1><div id="body-content"><p></b>See ride on Strava</b></p></div></div>'),e.open(map,n.marker)})})},map=new google.maps.Map(document.getElementById("map"),{center:new google.maps.LatLng(51.45021,2.180518),zoom:6});ko.applyBindings(new viewModel);